<html style="padding-top: 0px !important" data-lt-installed="true"><head>
<meta http-equiv="content-type" content="text/html; charset=windows-1252"><style id="annotator-dynamic-style">.annotator-adder, .annotator-outer, .annotator-notice {
  z-index: 1020;
}
.annotator-filter {
  z-index: 1010;
}</style></head><body class="vsc-initialized"><div class="">
<h1>CS 352 Welcome Page </h1>
<p>
  Welcome back! Your last visit was at: %YEAR-%MONTH-%DAY %HOUR-%MINUTE-%SECOND
</p><p>


</p><div class="annotator-outer annotator-viewer annotator-hide">
  <ul class="annotator-widget annotator-listing"></ul>
</div><div class="annotator-outer annotator-editor annotator-hide">
  <form class="annotator-widget">
    <ul class="annotator-listing"><li class="annotator-item"><textarea id="annotator-field-0" placeholder="Comments…"></textarea></li><li class="annotator-item"><input id="annotator-field-1" placeholder="Add some tags here…"></li></ul>
    <div class="annotator-controls">
      <a href="#cancel" class="annotator-cancel">Cancel</a>
<a href="#save" class="annotator-save annotator-focus">Save</a>
    </div>
  </form>
</div><div class="annotator-adder" style="display: none;"><button>Annotate</button></div></div><div class="annotator-filter hidden" style="">
  <strong>Navigate:</strong>
<span class="annotator-filter-navigation">
  <button class="annotator-filter-previous">Previous</button>
<button class="annotator-filter-next">Next</button>
</span>
<strong>Filter by:</strong>
<span class="annotator-filter-property">
  <label for="annotator-filter-text">Annotation</label>
  <input id="annotator-filter-text" placeholder="Filter by Annotation…">
  <button class="annotator-filter-clear" style="display: none;">Clear</button>
</span><span class="annotator-filter-property">
  <label for="annotator-filter-tags">Tag</label>
  <input id="annotator-filter-tags" placeholder="Filter by Tag…">
  <button class="annotator-filter-clear" style="display: none;">Clear</button>
</span></div><div class="annotator-notice"></div></body></html>
